import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom'

const Rate = () => {
    const { content_id } = useParams();

    useEffect(() => {
        console.log(content_id);
    });
    return (
        <h1>Rate</h1>
    );
};

export default Rate;
